import React from 'react';

function Block() {
  return (
    <article className="article_block">
      <div className="article_left">
        <div className="article_heading">
          <h1>
            WER
            <br />
            WIR SIND
          </h1>
        </div>
      </div>
      <div className="article_right">
        <p>
          Die von George Soros gegründeten Open Society Foundations sind die
          weltweit größten privaten Geldgeber unabhängiger Gruppen, die sich für
          Gerechtigkeit, demokratische Regierungsführung und Menschenrechte
          einsetzen. Wir stellen jedes Jahr Tausende von Zuschüssen über ein
          Netzwerk nationaler und regionaler Stiftungen und Büros bereit und
          finanzieren eine Vielzahl von Projekten, von denen viele jetzt von den
          Herausforderungen der COVID-19-Pandemie geprägt sind.
        </p>
      </div>
    </article>
  );
}

export default class Main extends React.Component {
  render() {
    return (
      <main>
        <div className="container"></div>
      </main>
    );
  }
}
